-- ===================================
-- Migration: Seed Location Tables
-- Version: 000003
-- Description: Insert location data (provinces, districts, sub_districts)
-- ===================================

BEGIN;

-- ============================================
-- Provinces (77 records)
-- ============================================



-- ============================================
-- Districts (929 records)
-- ============================================


SELECT setval('districts_id_seq', (SELECT MAX(id) FROM districts));

-- ============================================
-- Sub Districts (169 sample records)
-- ============================================


SELECT setval('sub_districts_id_seq', (SELECT MAX(id) FROM sub_districts));

-- Verify location data
DO $$
DECLARE
  province_count INT;
  district_count INT;
  sub_district_count INT;
BEGIN
  SELECT COUNT(*) INTO province_count FROM provinces;
  SELECT COUNT(*) INTO district_count FROM districts;
  SELECT COUNT(*) INTO sub_district_count FROM sub_districts;

  RAISE NOTICE '==========================================';
  RAISE NOTICE 'Location Data Summary:';
  RAISE NOTICE '==========================================';
  RAISE NOTICE 'Provinces: % records', province_count;
  RAISE NOTICE 'Districts: % records', district_count;
  RAISE NOTICE 'Sub Districts: % records', sub_district_count;
  RAISE NOTICE '==========================================';
  RAISE NOTICE 'Location data loaded successfully!';
END $$;

COMMIT;
